const retrievedResume=JSON.parse(localStorage.getItem("resumeDB"));let resumeHTML=document.getElementById("resume");for(let e=0;e<retrievedResume.length;e++){let s=retrievedResume[e];resumeHTML.innerHTML+=`\n    <article class="d-flex flex-column" id="resumeHead">\n    <h1 class="resumeTags">${s.name}</h1>\n    <h5 class="resumeTags"><a id="email" href="mailto:${s.email}">${s.email}</a></h5>\n    <h2 class="resumeTags sectionHeads">${s.work}</h1>\n    </article>\n\n    <article class="d-flex flex-column" id="mnpd">\n    <h3 class="resumeTags">${s.job1}</h3>\n    <h5 class="resumeTags">${s.job1dates}</h5>\n    <h4 class="resumeTags">Roles within the Department:</h4>\n    <h5 class="resumeTags">${s.job1role1}</h5>\n    <h5 class="resumeTags">${s.job1role2}</h5>\n    <h5 class="resumeTags">${s.job1role3}</h5>\n    </article>\n    \n    <article class="d-flex flex-column" id="dell">\n    <h3 class="resumeTags">${s.job2}</h3>\n    <h5 class="resumeTags">${s.job2dates}</h5>\n    <h4 class="resumeTags">Roles within the Department:</h4>\n    <h5 class="resumeTags">${s.job2role1}</h5>\n    <h5 class="resumeTags">${s.job2role2}</h5>\n    </article>\n    \n    <article class="d-flex flex-column" id="education">    \n    <h2 class="resumeTags sectionHeads">${s.education}</h2>\n    <h5 class="resumeTags">${s.school}</h5>\n    <h5 class="resumeTags">${s.degree}</h5>\n    </article>\n    \n    `}